import React from 'react';

import {withFirebase } from '../Firebase';
import "./Signout.css";

const LogOutButton =({firebase }) => (

  <p> id="this_beautiful_thing" type="button" onClick={firebase.doSignOut}>
    Sign Out
    </p>
);


export default withFirebase(LogOutButton);
